import React, { useEffect, useState } from 'react';
import axios from 'axios';


const BASE_URL = 'http://localhost:5000';

function Comments() {
    const [comments, setComments] = useState([]);
    const [error, setError] = useState(null);
    const [newcomments, setNewComments] = useState({ text: '', userId: '1', createdAt: '', updatedAt: '' });


    useEffect(() => {
        const fetchComments = async () => {
            try {
                const response = await axios.get(`${BASE_URL}/comments`);
                setComments(response.data);
                console.log(response.data);
            } catch (err) {
                setError('Failed to fetch posts');
                console.error(err);
            }
        };

        fetchComments();
    }, []);

    const CommentCreate = async () => {
        try {
            const response = await axios.post(`${BASE_URL}/comments`, newcomments);
            setComments([...comments, response.data]);
            setNewComments({ title: '', description: '', userId: '1', createdAt: '', updatedAt: '' });
        } catch (err) {
            setError('Failed to create post');
            console.error(err);
        }
    };


    const handleInputChange = (e, commentType) => {
        const { name, value } = e.target;
        if (commentType === 'create') {
            setNewComments(prev => ({ ...prev, [name]: value }));

        };

            return (
                <div>
                    <div>
                        <h3>Create comment</h3>
                        <input
                            type="text"
                            name="title"
                            placeholder="Comment"
                            value={newcomments.title}
                            onChange={(e) => handleInputChange(e, 'create')}
                        />
                        <input
                            type="datetime-local"
                            name="createdAt"
                            placeholder="Created At"
                            value={newcomments.createdAt}
                            onChange={(e) => handleInputChange(e, 'create')}
                        />
                        <input
                            type="datetime-local"
                            name="updatedAt"
                            placeholder="Updated At"
                            value={newcomments.updatedAt}
                            onChange={(e) => handleInputChange(e, 'create')}
                        />
                        <button onClick={CommentCreate}>Create</button>
                    </div>
        
                    <table border="1" cellPadding="10" cellSpacing="0">
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>Text</th>
                                <th>PostId</th>
                                <th>User ID</th>
                                <th>Created At</th>
                                <th>Updated At</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {comments.map((comment) => (
                                <tr key={comment.id}>
                                    <td>{comment.id}</td>
                                    <td>{comment.text}</td>
                                    <td>{comment.postId}</td>
                                    <td>{comment.userId}</td>
                                    <td>{new Date(comment.createdAt).toLocaleString()}</td>
                                    <td>{new Date(comment.updatedAt).toLocaleString()}</td>
                                    <td>
                                        <button onClick={() => handleEdit(comment.id)}>Edit</button>
                                        <button onClick={() => handleDelete(comment.id)}>Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            );
        }
    }
        export default Comments;
